import React from "react";
import { Typography, Box, Stack, TextField, FormControl, InputLabel, Select, MenuItem } from "@mui/material";
import { Link } from "react-router-dom";

const Transfer = () => {
	const [token, setToken] = React.useState("");

	const handleChange = (event) => {
		setToken(event.target.value);
	};

	return (
		<>
			<Box sx={{ p: 3 }}>
				<Stack spacing={2} direction="column" justifyContent="center">
					<Typography variant="h6">Transfer</Typography>
					<Stack direction="column" justifyContent="space-evenly" alignItems="center" spacing={1}>
						<Typography align="left" variant="h7">보내는 사람 </Typography>
						<TextField id="FromAddress" label="From Address" variant="outlined" size="small" />
					</Stack>
					<Stack direction="row" justifyContent="space-between" alignItems="center" spacing={2}>
						<Typography variant="h7">받는 사람 : </Typography>
						<TextField id="ToAddress" label="To Address" variant="outlined" size="small" />
					</Stack>
					<Stack direction="row" justifyContent="space-between" alignItems="center" spacing={2}>
						<Typography variant="h7">토큰 선택 : </Typography>
						<FormControl fullWidth size="small">
							<InputLabel id="demo-simple-select-helper-label">Token</InputLabel>
							<Select labelId="demo-simple-select-helper-label" id="demo-simple-select-helper" value={token} label="Token" onChange={handleChange}>
								<MenuItem value="">
									<em>None</em>
								</MenuItem>
								<MenuItem value={10}>NEO</MenuItem>
								<MenuItem value={20}>Token1</MenuItem>
							</Select>
						</FormControl>
					</Stack>
					<Stack direction="row" justifyContent="space-between" alignItems="center" spacing={2}>
						<Typography variant="h7">수수료 : </Typography>
						<TextField id="GasFee" label="0.0012 NEO" variant="outlined" size="small" disabled />
					</Stack>
				</Stack>
			</Box>
			인풋 폼 보내는 사람 : 로그인 계정, 계정 주소 받는 사람 주소 토큰 선택 : select로 토큰 리스트 & 잔액 표시 수량 : NEO 수수료 : disable
		</>
	);
};

export default Transfer;
